import React from 'react'

export default function thankyou() {
  return (
    <div>
      <p>To My Dearest [Girlfriend's Name],<br/>

On this special day, I want to fill this virtual space with the warmth of my love and the depth of my feelings for you. As I look at your beautiful photo on the left, I am reminded of all the incredible moments we've shared together.<br/>

You are the light of my life, and your smile brightens even the darkest days. Your laughter is a melody that brings joy to my heart, and your presence is a comfort like no other.<br/>

Every day spent with you is a gift, and I cherish every moment we've had and look forward to all the moments yet to come. You make my life better in every way, and I am grateful for your love, your kindness, and your unwavering support.<br/>

On this special day, I want to remind you how much you mean to me. You are not just my girlfriend; you are my best friend, my confidant, and my greatest love. You make every day better, and I can't imagine my life without you in it.<br/>

Happy Birthday, my love. May this day be as bright and beautiful as you are. Here's to many more birthdays and countless memories together.</p>
    </div>
  )
}
